import React, {Component} from 'react'
import Layout from "../_layouts/default/Layout";

class CompositionsPage extends Component {
    render() {
        return (
            <Layout pageCaption="Листинг композиций" drawer={false}>
                <div>
                    <h1>Compositions</h1>
                </div>
            </Layout>
        )
    }
}

export default CompositionsPage
